/// $INTERFACE TspTsioScReg            biu              (4,4)
///     # # ----------------------------------------------------------
///     @ 0x00000 global               (P)
///               %unsigned 1  En                        0x0
///                                    ###
///                                    * 1: Enable the TSIO
///                                    * 0: Disable the TSIO
///                                    * When disabled all internal states and buffers are cleared.
///                                    ###
///               %%        31         # Stuffing bits...
///     @ 0x00004                      (P)
///     # 0x00004 StfPktParams         
///               $TsioStfPkt          StfPktParams      REG          
///                                    ###
///                                    * SW Programmable fields in the transmit stuffing packet
///                                    ###
///     @ 0x00010 TsioTxCtrl           (P)
///               ###
///               * Following delays are in increments of TSIO Clock
///               ###
///               %unsigned 32 InRstNoClockDelay         0x10
///                                    ###
///                                    * Delay between enabling TSIO and output of training pattern.
///                                    * In Reset (no clock) state in TSIO specification
///                                    ###
///     # 0x00014 TsioTxCtrl1          
///               %unsigned 32 InRstClockDelay           0xE
///                                    ###
///                                    * Delay between start of training pattern and the start of SoC training.
///                                    * In Reset (verifying clock) + Smart Card Training states in TSIO specification
///                                    ###
///     # 0x00018 TsioTxCtrl2          
///               %unsigned 32 SoCTrainDelay             0xC
///                                    ###
///                                    * Delay between start of SoC training and operational mode
///                                    * SoC Training state in TSIO specification
///                                    ###
///     @ 0x0001C TsioRxCtrl           (P)
///               %unsigned 3  ClkSel                    0x2
///                                    ###
///                                    * Selection of frequency of the TSO clock output to TSP
///                                    * 3b000: TSIO Clock
///                                    * 3b001: TSIO Clock / 2
///                                    * 3b010: TSIO Clock / 4
///                                    * 3b011: TSIO Clock / 6
///                                    * 3b100: TSIO Clock / 8
///                                    * 3b101: TSIO Clock / 12
///                                    * Others: TSIO Clock / 2
///                                    ###
///               %unsigned 1  Reserved0                 0x0
///               %unsigned 6  ScStfPktServiceId         0x0
///                                    ###
///                                    * Field for identifying stuffing packets received from the SmartCard.
///                                    * IDs matching this field will be discarded.
///                                    ###
///               %unsigned 2  Reserved1                 0x0
///               %unsigned 4  SyncLockMin               0x3
///                                    ###
///                                    * Number of Sync Bytes found before synchronization lock is declared.
///                                    * Value range: 3 - 15
///                                    * Note: Minimum is clamped at 3.
///                                    ###
///               %unsigned 1  RcvStfPkt                 0x0
///                                    ###
///                                    * 0: Received Stuffing Packets are discarded
///                                    * 1: Received Stuffing Packets passed on to TS interface
///                                    * This is used as a debug option.
///                                    * By default it is not advised to pass the stuffing packet back to the stream processor due to bandwidth limitations.
///                                    ###
///               %unsigned 1  RcvDataSampNeg            0x0
///                                    ###
///                                    * 0: RX_DATA is sampled on the positive edge of RX_DCLK
///                                    * 1: RX_DATA is sampled on the negative edge of RX_DCLK
///                                    ###
///               %%        14         # Stuffing bits...
///     @ 0x00020 TsioTxCnC            (W-)
///               %unsigned 8  Data                      
///               %unsigned 1  FirstByte                 
///               %unsigned 1  LastByte                  
///                                    ###
///                                    * FIFO buffer interface for C&C output. A write will push into the FIFO
///                                    * Writing to this buffer must follow the rules specified for the C&C command channel.
///                                    * Once LastByte is written, wait for CnCTxDone before writing the next C&Cs FirstByte.
///                                    ###
///               %%        22         # Stuffing bits...
///     @ 0x00024 TsioRxCnC            (R-)
///               %unsigned 8  Data                      
///               %unsigned 1  ByteValid                 
///               %unsigned 1  LastByte                  
///                                    ###
///                                    * FIFO buffer interface for C&C output. A read will pop from the FIFO.
///                                    * If buffer is empty, the data read back will be 0s.
///                                    ###
///               %%        22         # Stuffing bits...
///     @ 0x00028 TsioRxCnCCnt         (R-)
///               %unsigned 16 Count                     
///                                    ###
///                                    * Number of valid entries in receive FIFO up to a maximum of 258 bytes.
///                                    ###
///               %%        16         # Stuffing bits...
///     @ 0x0002C TsioSts              (R-)
///               %unsigned 1  SyncLock                  
///                                    ###
///                                    * Transmitter is currently synched
///                                    ###
///               %unsigned 1  RxChkPass                 
///                                    ###
///                                    * RxChkCnt == RxChkMatch
///                                    ###
///               %unsigned 2  Reserved0                 0x0
///               %unsigned 8  SyncLostCnt               
///                                    ###
///                                    * Number of times sync lock has been lost since the first sync lock after TSIO is enabled
///                                    ###
///               %unsigned 3  TxState                   
///                                    ###
///                                    * Transmitter state for debug use
///                                    ###
///               %unsigned 1  AutoBistIdle              
///                                    ###
///                                    * Auto-BIST is idle
///                                    ###
///               %unsigned 1  AutoBistLock              
///                                    ###
///                                    * AutoBist achieved lock
///                                    * Bit clears on AutoBistStart 0->1 transition.
///                                    ###
///               %unsigned 1  AutoBistErr               
///                                    ###
///                                    * AutoBist encountered error
///                                    * Bit clears on AutoBistStart 0->1 transition.
///                                    ###
///               %%        14         # Stuffing bits...
///     @ 0x00030 TsioIntEn            (P)
///               ###
///               * Writing ones to any bit will enable the interrupt for the corresponding bit.
///               ###
///               %unsigned 1  tsi0OvrFlw                0x0
///                                    ###
///                                    * tsi input overflowed
///                                    ###
///               %unsigned 1  tsi1OvrFlw                0x0
///                                    ###
///                                    * tsi input overflowed
///                                    ###
///               %unsigned 1  RxSyncLost                0x0
///                                    ###
///                                    * Sync lost detected
///                                    ###
///               %unsigned 1  CnCTxDone                 0x0
///                                    ###
///                                    * C&C transmit done
///                                    ###
///               %unsigned 1  CnCTxErr                  0x0
///                                    ###
///                                    * C&C transmit error
///                                    ###
///               %unsigned 1  CnCRxDone                 0x0
///                                    ###
///                                    * C&C receive done
///                                    ###
///               %unsigned 1  CnCRxIdleErr              0x0
///                                    ###
///                                    * C&C receive error encountered during IDLE
///                                    ###
///               %unsigned 1  CnCRxAsmErr               0x0
///                                    ###
///                                    * C&C receive error encountered during ASSEMBLE or
///                                    * Buffer overflow
///                                    ###
///               %%        24         # Stuffing bits...
///     @ 0x00034 TsioIntSts           (WOC-)
///               ###
///               * Writing ones to any of the bits will clear those bits. The status will still flag the various states even if TsioIntEn for that bit is 0
///               ###
///               %unsigned 1  tsi0OvrFlw                0x0
///               %unsigned 1  tsi1OvrFlw                0x0
///               %unsigned 1  RxSyncLost                0x0
///               %unsigned 1  CnCTxDone                 0x0
///               %unsigned 1  CnCTxErr                  0x0
///               %unsigned 1  CnCRxDone                 0x0
///               %unsigned 1  CnCRxIdleErr              0x0
///               %unsigned 1  CnCRxAsmErr               0x0
///               %%        24         # Stuffing bits...
///     @ 0x00038 TsioPhyCtrl          (P)
///               %unsigned 2  TSIO_CK_MODE              0x0
///                                    ###
///                                    * 2b00 : 400 Mbps
///                                    * 2b01 : 200 Mbps
///                                    * 2b10 : 100 Mbps
///                                    * 2b11 : 50 Mbps
///                                    ###
///               %unsigned 6  TSIO_TST_SEL              0x0
///                                    ###
///                                    * Analog test point select
///                                    * [5:4]=00 : TX
///                                    * [5:4]=01 : RX
///                                    * [5:4]=10 : MDLL
///                                    ###
///               %unsigned 1  TSIO_LB_EN                0x0
///                                    ###
///                                    * Loopback mode enable
///                                    ###
///               %unsigned 1  TSIO_LB_SEL               0x0
///                                    ###
///                                    * Loopback path selection
///                                    * 0: From TX data lane path
///                                    * 1: From TX clock lane path
///                                    ###
///               %unsigned 1  TSIO_TX_INVERT            0x0
///                                    ###
///                                    * 1: TSIO controller will invert TX_DATA before sending to PHY
///                                    ###
///               %unsigned 1  TSIO_RX_INVERT            0x0
///                                    ###
///                                    * 1: TSIO controller will invert RX_DATA after receiving from PHY
///                                    ###
///               %unsigned 16 TSIO_RSVD                 0x3
///                                    ###
///                                    * Reserved inputs
///                                    * [2:1]: MDLL REG_SEL
///                                    * [0] : CDR_EN
///                                    ###
///               %%        4          # Stuffing bits...
///     @ 0x0003C TsioPhyCdr           (P)
///               %unsigned 1  TSIO_CDR_EXT_EN           0x0
///                                    ###
///                                    * Enable the external CDR and disable the internal CDR
///                                    ###
///               %unsigned 4  TSIO_CDR_EXT              0x0
///                                    ###
///                                    * Only active when TSIO_CDR_EXT_EN=1
///                                    ###
///               %unsigned 8  TSIO_CDR_CTRL             0x37
///                                    ###
///                                    * [7]: Rx skip cnt enable
///                                    * [6] Rx data shift enable
///                                    * [5] : Loss of sync enable
///                                    * [4] : FIFO overflow enable
///                                    * [3] : Edge opt. enable
///                                    * [2] : filter 3 enable
///                                    * [1] : filter 2 enable
///                                    * [0] : filter 1 enable
///                                    ###
///               %%        19         # Stuffing bits...
///     @ 0x00040 TsioPhyTx            (P)
///               %unsigned 3  TSIO_TX_AMP               0x4
///                                    ###
///                                    * TX amplitude Control
///                                    ###
///               %unsigned 1  TSIO_TX_OE                0x1
///                                    ###
///                                    * TX output control
///                                    ###
///               %unsigned 1  TSIO_TX_SR                0x0
///                                    ###
///                                    * TX slew rate control
///                                    ###
///               %unsigned 1  TSIO_TX_IMP_EN            0x1
///                                    ###
///                                    * TX termination enable
///                                    ###
///               %unsigned 5  TSIO_TX_IMP               0x10
///                                    ###
///                                    * TX termination code
///                                    * TSIO_TX_IMP[3] is reserved
///                                    ###
///               %unsigned 1  TSIO_TX_PU                0x0
///                                    ###
///                                    * Power up TX
///                                    ###
///               %%        20         # Stuffing bits...
///     @ 0x00044 TsioPhyRx            (P)
///               %unsigned 1  TSIO_RX_IMP_EN            0x1
///                                    ###
///                                    * RX termination enable
///                                    ###
///               %unsigned 5  TSIO_RX_IMP               0x10
///                                    ###
///                                    * RX termination code
///                                    * TSIO_RX_IMP[3] is reserved
///                                    ###
///               %unsigned 1  TSIO_RX_PU                0x0
///                                    ###
///                                    * Power up RX
///                                    ###
///               %%        25         # Stuffing bits...
///     @ 0x00048 TsioPhySts           (R-)
///               %unsigned 8  TSIO_RSVD_O               0x0
///                                    ###
///                                    * Reserved output
///                                    * [2:0] STALL_SKIP_CNT
///                                    ###
///               %unsigned 4  TSIO_CDR_FLAG             0x0
///                                    ###
///                                    * CDR output flags
///                                    * [3]: Reserved
///                                    * [2]: Sbuf_skip_ovf
///                                    * [1]: Fifoovf_error
///                                    * [0]: Poor data qual
///                                    ###
///               %%        20         # Stuffing bits...
///     @ 0x0004C TsioBist0            (P)
///               %unsigned 1  LoopBackEn                0x0
///                                    ###
///                                    * 1: Tx is digitally looped back to Rx before the PHY
///                                    * 0: Normal mode
///                                    ###
///               %unsigned 1  AutoBistStart             0x0
///                                    ###
///                                    * Set this bit to 1 to start auto-bist. Choose the test pattern desired first in TsioBist1 before starting auto-bist.
///                                    * Programming a 0 to this bit will stop AutoBist.
///                                    * Using one of the PRBS patterns is recommended.
///                                    ###
///               %%        30         # Stuffing bits...
///     @ 0x00050 TsioBist1            (P)
///               %unsigned 1  TxPattEn                  0x0
///                                    ###
///                                    * 1: Test pattern is sent out the Tx
///                                    * 0: Normal mode
///                                    * Note: Ignored with auto-bist. Auto-bist will always send pattern selected out the Tx.
///                                    ###
///               %unsigned 3  TxPattSel                 0x0
///                                    ###
///                                    * 3b000 : 1T (101010)
///                                    * 3b001 : 2T (11001100)
///                                    * 3b010 : 5T (1111100000...)
///                                    * 3b011 : 10T (11111111110000000000)
///                                    * 3b100 : PRBS7 (X7+X6+1)
///                                    * 3b101 : PRBS15 (X15+X14+1)
///                                    * 3b110 : PRBS31 (X31+X28+1)
///                                    * 3b111 : User Defined
///                                    ###
///               %unsigned 12 Reserved0                 0x0
///               %unsigned 16 UserPattern               0x88
///                                    ###
///                                    * User defined pattern used when TxPattSel = 3b111
///                                    * 0
///                                    ###
///     @ 0x00054 TsioBist2            (P)
///               ###
///               * Not used with auto-bist
///               ###
///               %unsigned 1  RxChkEn                   0x0
///                                    ###
///                                    * 1: Received pattern will be checked against the transmit pattern
///                                    * 0: Checker disabled, counters are reset
///                                    ###
///               %unsigned 1  RxChkStop                 0x0
///                                    ###
///                                    * Only has effect if RxChkEn = 1.
///                                    * 0: Checker counters are enabled.
///                                    * 1: Checker counters stops and holds their value
///                                    ###
///               %unsigned 2  Reserved0                 0x0
///               %unsigned 5  RefDataDly                0x0
///                                    ###
///                                    * Delays the TxPattern data by RefDataDly cycles when used as reference data for checking
///                                    * In AutoBist mode, this register is overwritten by the locked delay value.
///                                    ###
///               %%        23         # Stuffing bits...
///     @ 0x00058 TsioBist3            (R-)
///               %unsigned 32 RxChkCnt                  0x0
///                                    ###
